import React from 'react';
import './Sidebar.css';
import Row from 'react-bootstrap/Row';

export default class Sidebar extends React.Component {
  render() {
    return (
      <div className='sidebar'>
        <Row>
          <h1 className="text-center"><a href="index.js">Tasktastic!</a></h1>
        </Row>
        <Row>
        <div class="panel-group views">
          <div class="panel panel-default">
              <div class="panel-heading">
                <h2 class="panel-title">
                  <a data-bs-toggle="collapse" href="#collapse1">Views</a>
                </h2>
              </div>
              <div id="collapse1" class="panel-collapse collapse">
                <ul class="list-group">
                  <li class="list-group-item"><h4>Calendar</h4></li>
                  <li class="list-group-item"><h4>Categories</h4></li>
                </ul>
              </div>
            </div>
          </div>
        </Row>
      </div>
    );
  }
}
